import React from 'react';

const AttendeeBox = ({ attendees, handleRemove }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Email</th>
          <th>Assigned Event</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {attendees.map((attendee) => (
          <tr key={attendee.id}>
            <td>{attendee.name}</td>
            <td>{attendee.email}</td>
            <td>{attendee.eventName ? attendee.eventName : 'No Event'}</td>
            <td>
              <button onClick={() => handleRemove(attendee.id)}>Remove</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default AttendeeBox;
